int fn(int *a, int *b) {
  *a = *a + *b;
  return (*b = *a - *b);
}
int main() {
  int x = 2;
  int y = 3;
  printf("%d", fn(&x, &y) + y);
  return 0;
}

typedef struct { int x; } Struct;
void change(Struct *a, Struct b) {
  a->x += b.x;
  b.x = 100;
  a = &b;
  a->x = 200;
}
int main() {
  Struct b1 = {3};
  Struct b2 = {4};
  change(&b1, b2);
  printf("%d ", b1.x);
  return 0;
}

